import React from "react";
import { Image } from 'react-native';
import prod5 from '../../../assets/topo.png';

export default function Error() {
    return <>
    <Image source={prod5} style={estilos.imgproduto}/>
    </>;
}

const estilos = StyleSheet.create({
    imgproduto: { //imagem do produto
        width: 80,
        height: 80,
        marginHorizontal: 20,
        marginVertical: 20,
        borderRadius: 15,
        
    },
})
